    <script>
    document.addEventListener("DOMContentLoaded", function() {

        window.MAP = map_0361e748a172bf9234b99085655a225b;

        var STREETS = [];

        function getDist(a, b) {
            // приблизительно в метрах через градусы
            var dx = (a[0] - b[0]) * 111000;
            var dy = (a[1] - b[1]) * 111000;
            return Math.sqrt(dx*dx + dy*dy);
        }

        function highlightStreet(coords, name, meters) {
            L.polyline(coords, {
                color: 'blue',
                weight: 12,
                opacity: 0.6
            }).addTo(MAP);

            var mid = coords[Math.floor(coords.length/2)];
            L.popup()
                .setLatLng(mid)
                .setContent("Ближайшая улица: <b>" + name + "</b><br>Расстояние: " + meters.toFixed(1) + " м")
                .openOn(MAP);

            MAP.flyTo(mid, 16);
        }

        function showNearestStreet() {
            if (!navigator.geolocation) {
                alert("Браузер не поддерживает геолокацию");
                return;
            }

            navigator.geolocation.getCurrentPosition(function(pos) {
                var u = [pos.coords.latitude, pos.coords.longitude];

                var minD = Infinity;
                var nearest = null;

                STREETS.forEach(function(s) {
                    // расстояние до средней точки линии
                    var mid = s.coords[Math.floor(s.coords.length/2)];
                    var d = getDist(u, mid);
                    if (d < minD) {
                        minD = d;
                        nearest = s;
                    }
                });

                if (!nearest) {
                    alert("Не найдено улиц");
                    return;
                }

                highlightStreet(nearest.coords, nearest.name, minD);

                L.marker(u).addTo(MAP).bindPopup("Вы здесь").openPopup();

            }, function(err) {
                alert("Ошибка геолокации: " + err.message);
            }, {
                enableHighAccuracy: true
            });
        }

        // Кнопка
        var btn = document.createElement("button");
        btn.textContent = "Показать ближайшую улицу ко мне";
        btn.style.position = "absolute";
        btn.style.top = "10px";
        btn.style.left = "50%";
        btn.style.transform = "translateX(-50%)";
        btn.style.padding = "8px 12px";
        btn.style.background = "white";
        btn.style.border = "1px solid #888";
        btn.style.borderRadius = "6px";
        btn.style.zIndex = 99999;
        btn.onclick = showNearestStreet;

        document.body.appendChild(btn);

    });
    </script>
